import React from 'react'
import Typed from 'react-typed';
import img1 from '/Users/duaashahid/Desktop/olive/src/pictures-olive/home-page-picture.png';

function Main() {
  return (
    <div className='w-full h-[500px] py-10 px-70  ml-0 mr-  bg-[#F1F8FF] justify-stretch '>
        <div className='max-w-[2000px] w-full h-screen mx-1000 px-200  text-left  justify-center mx-auto grid md:grid-cols-2'>

            <div className='justify-left px-20 p-1 '>
            <h1 className='text-black p-1 md:text-5xl sm:text-4xl text-3xl font-semibold py-1 my-5'>Tech Experts for </h1>

            <Typed
                className='md:text-5xl sm:text-4xl text-3xl font-semibold  md:pl-4 pl-2'
                strings={['IT,', 'SAP,', 'Training.']}
                typeSpeed={120}
                backSpeed={140}
                loop
          />

                <p className='flex md:text-2xl sm:text-xl text-xl py-4 px-3 justify-left'>
                Welcome to OLIVE Technical Services, the leading provider of comprehensive
                IT & SAP, plant services, and Trainings.
            </p>
            <button className='bg-[#1D5ADE] w-[200px] rounded-full font-medium  my-5 py-3 px-3 mx-3 text-white'>View all Services</button>

          </div>

          <div className='w-[500px] mx-auto  flex-col mx-500 my-6 px-20'>
                <img src={img1} alt=''/>
            </div>

            </div>

    </div>         
  )
}

export default Main
